server:
  port: 3366
spring:
  application:
    name: config
  cloud:
    #compatibility-verifier:
      #enabled: false
    config:
      #discovery:
        #enabled: true
        #service-id: config
      uri:
        http://localhost:3344
      profile:
        dev
      name:
        config
      label:
        master
      #server:
        #bootstrap: true
eureka:
  instance:
    hostname: localhost
  client:
    service-url:
      defaultZone: http://localhost:7001/eureka/
    #register-with-eureka: false
    #fetch-registry: false